import "./nav.css";
import home from "../assets/images/home.svg";
import NavButton from "./NavButton";
const Nav=(props)=>{
    const updateActiveBtn=()=>{
        if(props.pageName=="home"){
            return "navBtnActive";
        }
    }
    const navigateHome=()=>{
        console.log("Home button clicked");
    }

    const navigatePeers=()=>{
        console.log("Connections button clicked");
    }

    const navigateSearch=()=>{
        console.log("Search button clicked");
    }

    const navigateNotif=()=>{
        console.log("Notifications button clicked");
    }

    const navigateProfile=()=>{
        console.log("Profile button clicked");
    }
    return(
        <nav>
            <ul>
                <li><NavButton className="navBtnActive" label="Home" name="homeBtn" onClick={navigateHome} /></li>
                <li><NavButton className="navBtn" label="Peers" name="peersBtn" onClick={navigatePeers}/></li>
                <li><NavButton className="navBtn" label="Search" name="searchBtn" onClick={navigateSearch} /></li>
                <li><NavButton className="navBtn" label="Notif" name="notiBtn" onClick={navigateNotif}/></li>
                <li><NavButton className="navBtn" label="Profile" name="profileBtn" onClick={navigateProfile}/></li>
            </ul>
        </nav>
    )
}
export default Nav;
